            <th>First Name</th>
            <th>Second Name</th>
            <th>Date of birth</th>
            <th>HealthCard Number</th>
            <th>Gender</th>
          </tr>
        </thread>
        <tbody>
          {patientInfo.map((patient)=>
          <tr>
